import React from "react";
import {Buttons, SingleDropDown, SearchBar} from ".."
import "../../.././assets/index.css";
import { NavLink } from "react-router-dom";
import DynamicFeedIcon from '@material-ui/icons/DynamicFeed';
import SearchIcon from '@material-ui/icons/Search';

const Header = ({authenticated}) =>{
    let onLogout= () =>{
        localStorage.clear();
        window.location.reload;
    }
    return (
        <div className="header">
            <div className="header-top">
                <div className="header-top_logo">
                    <p>Bear<span>Bulls</span></p>
                </div>

                <div className="header-top_left">
                    <div>   
                    <NavLink to="/register">
                        {!authenticated &&<Buttons className="buttons2" value = "Sign Up"/>}
                    </NavLink>
                    </div>
                    <div>
                        <NavLink to="/login">
                        {!authenticated &&
                            <Buttons className="buttons2" value = "Sign In"/>}
                        </NavLink>
                    </div>
                    <div style={{marginRight:"10px"}}>
                        <NavLink to="/searchUser">
                        {authenticated &&
                            <SearchIcon className="searchIcon" style={{ fontSize: 40 }}></SearchIcon>}
                        </NavLink>
                    </div>

                    <div style={{marginRight:"10px"}}>
                        <NavLink to="/feeds">
                        {authenticated &&
                            <DynamicFeedIcon className="feedIcon" style={{ fontSize: 40 }}></DynamicFeedIcon>}
                        </NavLink>
                    </div>

                    <div>
                        {authenticated &&
                        <SingleDropDown item1="View profile" item2="Logout" href1="/profile" onLogout={onLo}/>}
                    </div>
                </div>

            </div>
        </div>
    );
}

export default Header;
